    "2013-03-15T23:42:39.476352",nt"name": "dolomite-resources-of-washington-report-of-investigations-13",nt"isopen":
    false,nt"url": null,nt"notes": "In anticipation of the importance of the
    production of metallic magnesium specific plans were made several years ago for
    the study of the dolomite and magnesite resources of Washington. The demand for
    information became so urgent, however, that studies of magnesite were completed
    and reported before dolomite investigations were begun. This report, Part I of a
    series entitled "Dolomite Resources of Washington," constitutes the first unit
    of a more comprehensive study and covers only a few of the deposits which give promise
    of containing large tonnages of high-purity dolomite, Other units will follow as
    the work is finished. ",nt"license_title": null,nt"extras": [{ntt"key":
